import axios from "axios";

const BASEURL = "https://api.giphy.com/v1/gifs/search?api_key=G6fDbXcTyI7uGVHiwJf1fD8IsF8bA0W5&q=dogs&limit=25&offset=0&rating=g&lang=enhttps://api.giphy.com/v1/gifs/random?api_key=dc6zaTOxFJmzC&limit=20";

// Export an object with a "search" method that searches the Giphy API for the passed query
export default {
  getPuppyList: function() {
    return axios.get(BASEURL);
  }
};
